import React from 'react';
import {Typography, AppBar,CssBaseline ,Toolbar } from '@mui/material'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import { makeStyles } from '@mui/styles';
import logo from '../atoms/images/logo.png';
import Image from '../atoms/Image'
import User from '../atoms/User'
import Icons from '../atoms/Icons';
const useStyles = makeStyles(theme => ({
    avatar: {
      position: 'absolute',
      left:'75%',
       },
    arrow:{
      color: 'black',
      position: 'absolute',
      left:'74.69%'
    },
    search:{color: 'black',
      position: 'absolute',
      left: '23.69%',
      right: '7.03%',
      top: '34.88%',
      bottom: '7.03%'},
    logo:{position: 'absolute',
      left: '17.36%',
      right: '74.02%',
      top: '30.88%',
      bottom: '34.88%'
    },
  explore:{
      color: 'black',
      position: 'absolute',
      fontSize: '16px',
      fontStyle: 'normal',
      fontWeight: '500',
      lineHeight: '20px',
      letterSpacing: '0em',
      textAlign: 'left',
      left:'28.69%'
  },
  myLib:{
    color: 'black',
        position: 'absolute',
        left:'35.69%',
        fontSize: '16px',
        fontStyle: 'normal',
        fontWeight: '500',
        lineHeight: '20px',
        letterSpacing: '0em',
        textAlign: 'left'
  }
  })); 
interface Props{
  handleToggle?:any
}
const Navbar=(props:Props)=> {
    const classes=useStyles()
    return (
        <>
        <CssBaseline />
    <AppBar  style={{ background: '#FFFFFF'}} position='relative' elevation={0}>
      <Toolbar>
      <Image className={classes.logo} path={logo} />

      <Icons className={classes.search}>
      <SearchOutlinedIcon/>
      </Icons>

     <Typography className={classes.explore} variant='body1'>Explore</Typography>

      <KeyboardArrowDownIcon style={{ color: 'black',
      position: 'absolute',
      left:'32.69%',}} onClick={(e)=>props.handleToggle(e,1)}/>

      <Typography className={classes.myLib} variant='body1' >My Library</Typography>


      <User className={classes.avatar}  username="B" />

      <Icons className={classes.arrow}>
        <KeyboardArrowDownIcon />
      </Icons>

      </Toolbar>
    </AppBar>
        </>
    );
}

export default Navbar;
